import styled from "styled-components";

const Container = styled.div`
width: 430px;
padding: 0;
`;

const DetailsList = styled.ul`
max-width: 100%;
display: flex;
flex-wrap: wrap;
gap: 8px;
margin-bottom: 44px;
`;

const VehicleDetList = styled.ul`
width: 430px;
// margin-bottom: 44px;
`;

const VehicleDetItem = styled.li`
max-width: 100%;
display: flex;
justify-content: space-between;
gap: 8px;
`;
export {Container, DetailsList, VehicleDetList, VehicleDetItem}
